import { IonButton, IonCardHeader, IonCardSubtitle, IonCardTitle, IonItem, IonThumbnail } from "@ionic/react";

interface DataFormat {
  id: number;
  name: string;
  description: string;
  image: string;
}

interface ContainerProps {
  data: DataFormat;
}

const ItemList: React.FC<ContainerProps> = ({ data }) => {
  console.log();
  return (
    <>
      <IonItem>
        <IonThumbnail slot="start">
          <img alt="Silhouette of mountains" src="https://ionicframework.com/docs/img/demos/thumbnail.svg" />
        </IonThumbnail>
        <IonCardHeader>
          <IonCardTitle>Card Title</IonCardTitle>
          <IonCardSubtitle>Card Subtitle</IonCardSubtitle>
        </IonCardHeader>
        <IonButton slot="end" shape="round" fill="outline" routerLink={"custumerts/2"}>
          &gt;
        </IonButton>
      </IonItem>
    </>
  );
};

export default ItemList;
